E1.6">schon</ts><nts n="HIAT:ip" id="Seg_2741"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2743" s="T118.TIE1.6" e="T118.TIE1.7">gehabt</ts><nts n="HIAT:ip" id="Seg_2744"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2746" s="T118.TIE1.7" e="T119">auch</ts><nts n="HIAT:ip" id="Seg_2747">.</nts><nts n="HIAT:ip" id="Seg_2748"><![CDATA[ ]]></nts></ts><ts n="HIAT:u" id="Seg_2750" s="T119" e="T122"><ts n="HIAT:w" id="Seg_2752" s="T119" e="T119.TIE1.1">Ah</ts><nts n="HIAT:ip" id="Seg_2753">,</nts><nts n="HIAT:ip" id="Seg_2754"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2756" s="T119.TIE1.1" e="T119.TIE1.2">oftmals</ts><nts n="HIAT:ip" id="Seg_2757"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2759" s="T119.TIE1.2" e="T119.TIE1.3">ist</ts><nts n="HIAT:ip" id="Seg_2760"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2762" s="T119.TIE1.3" e="T119.TIE1.4">er</ts><nts n="HIAT:ip" id="Seg_2763"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2765" s="T119.TIE1.4" e="T119.TIE1.5">ihnen</ts><nts n="HIAT:ip" id="Seg_2766"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2768" s="T119.TIE1.5" e="T119.TIE1.6">auch</ts><nts n="HIAT:ip" id="Seg_2769"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2771" s="T119.TIE1.6" e="T119.TIE1.7">ausgkommen</ts><nts n="HIAT:ip" id="Seg_2772">,</nts><nts n="HIAT:ip" id="Seg_2773"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2775" s="T119.TIE1.7" e="T120">nicht</ts><nts n="HIAT:ip" id="Seg_2776">,</nts><nts n="HIAT:ip" id="Seg_2777"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2779" s="T120" e="T120.TIE1.1">voraus</ts><nts n="HIAT:ip" id="Seg_2780"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2782" s="T120.TIE1.1" e="T120.TIE1.2">der</ts><nts n="HIAT:ip" id="Seg_2783"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2785" s="T120.TIE1.2" e="T121">Schlei</ts><nts n="HIAT:ip" id="Seg_2786">,</nts><nts n="HIAT:ip" id="Seg_2787"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2789" s="T121" e="T121.TIE1.1">weil</ts><nts n="HIAT:ip" id="Seg_2790"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2792" s="T121.TIE1.1" e="T121.TIE1.2">der</ts><nts n="HIAT:ip" id="Seg_2793"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2795" s="T121.TIE1.2" e="T121.TIE1.3">recht</ts><nts n="HIAT:ip" id="Seg_2796"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2798" s="T121.TIE1.3" e="T121.TIE1.4">rutschig</ts><nts n="HIAT:ip" id="Seg_2799"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2801" s="T121.TIE1.4" e="T121.TIE1.5">gewesen</ts><nts n="HIAT:ip" id="Seg_2802"><![CDATA[ ]]></nts><ts n="HIAT:w" id="Seg_2804" s="T121.TIE1.5" e="T122">ist</ts><nts n="HIAT:ip" id="Seg_2805">.</nts><nts n="HIAT:ip" id="Seg_2806"><![CDATA[ ]]></nts></ts></ts></segmentation><segmentation name="SpeakerContribution_Event" tierref="TIE1"><ts n="sc" id="Seg_2807" s="T0" e="T31"><ts n="e" id="Seg_2809" s="T0" e="T1">Ja, da hat man erst einmal gehabt, </ts><ts n="e" id="Seg_2811" s="T1" e="T2">also, das Erste war der Schnürer. </ts><ts n="e" id="Seg_2813" s="T2" e="T3">• • • Und des war a • • a Stahldraht. </ts><ts n="e" id="Seg_2815" s="T3" e="T4">Meistens hat man einen Kupferdraht hergenommen, </ts><ts n="e" id="Seg_2817" s="T4" e="T5">weil er besser stehen geblieben ist. </ts><ts n="e" id="Seg_2819" s="T5" e="T6">• • Und da hat man eine Schlaufe gemacht, </ts><ts n="e" id="Seg_2821" s="T6" e="T7">wie der Wilderer, </ts><ts n="e" id="Seg_2823" s="T7" e="T8">wenn er ein Reh gefangen hat, nicht, </ts><ts n="e" id="Seg_2825" s="T8" e="T16">• </ts><ts n="e" id="Seg_2827" s="T16" e="T9">aber blos nicht so groß, nicht, </ts><ts n="e" id="Seg_2829" s="T9" e="T10">und nachert ist man den, den Schnürer, </ts><ts n="e" id="Seg_2831" s="T10" e="T11">des war ja grad ein ganz ein kleines Packerl, </ts><ts n="e" id="Seg_2833" s="T11" e="T12">das hat er überall einstecken können. </ts><ts n="e" id="Seg_2835" s="T12" e="T13">Das ist nicht aufgefallen, nicht, </ts><ts n="e" id="Seg_2837" s="T13" e="T196">weil da waren ja die Fischaufseher auch da, nicht. </ts><ts n="e" id="Seg_2839" s="T196" e="T14">((holt Luft,0,6s))</ts><ts n="e" id="Seg_2841" s="T14" e="T15">Oh, oh. </ts><ts n="e" id="Seg_2843" s="T15" e="T18"></ts><ts n="e" id="Seg_2845" s="T18" e="T19">Ach woher, ja mein. </ts><ts n="e" id="Seg_2847" s="T19" e="T20">Bei uns hat ja das ganze Fischwasser da abher nachhereinand, </ts><ts n="e" id="Seg_2849" s="T20" e="T21">das hat dem, dem Besitzer, </ts><ts n="e" id="Seg_2851" s="T21" e="T22">den ehemaligen von, vo Unter…, von Tannegg, </ts><ts n="e" id="Seg_2853" s="T22" e="T23">• • ein gewissen Doktor F, </ts><ts n="e" id="Seg_2855" s="T23" e="T24">des war ja, • war ja a • Sau. </ts><ts n="e" id="Seg_2857" s="T24" e="T25">• Der wenn dich erwischt hat! </ts><ts n="e" id="Seg_2859" s="T25" e="T26">Der hat einmal einen Wilderer, </ts><ts n="e" id="Seg_2861" s="T26" e="T27">• • da hat der Wilderer, </ts><ts n="e" id="Seg_2863" s="T27" e="T28">der hat, der hat, einen, einen — </ts><ts n="e" id="Seg_2865" s="T28" e="T185">• • das war ja </ts><ts n="e" id="Seg_2867" s="T185" e="T186">dort </ts><ts n="e" id="Seg_2869" s="T186" e="T29">ein Mundraub, </ts><ts n="e" id="Seg_2871" s="T29" e="T30">wenn da einer — </ts><ts n="e" id="Seg_2873" s="T30" e="T31">• der hat vier, fünf Kinder gehabt und nichts, keine Arbeit, </ts></ts><ts n="sc" id="Seg_2874" s="T32" e="T197"><ts n="e" id="Seg_2876" s="T32" e="T33">• und hat er einen Rehbock angeschossen. </ts><ts n="e" id="Seg_2878" s="T33" e="T34">Dann ist der Rehbock zwischen der…, </ts><ts n="e" id="Seg_2880" s="T34" e="T35">• der Doktor F ist aushin gegangen, </ts><ts n="e" id="Seg_2882" s="T35" e="T36"> • • • und, und, und zwischen den Brücken, </ts><ts n="e" id="Seg_2884" s="T36" e="T37">zwischen den beiden Brücken ist der Rehbock • • umher, </ts><ts n="e" id="Seg_2886" s="T37" e="T188">und der, der </ts><ts n="e" id="Seg_2888" s="T188" e="T187"> Dings </ts><ts n="e" id="Seg_2890" s="T187" e="T38">ist nachhin danach. </ts><ts n="e" id="Seg_2892" s="T38" e="T39">• • Der Rehbock hat ja eh schon nicht mehr gekonnt. </ts><ts n="e" id="Seg_2894" s="T39" e="T40">• • Und nachhert ist der F gleich nachhin nachhert hat er ihn derwischt, nicht. </ts><ts n="e" id="Seg_2896" s="T40" e="T41">• Dann hat er ihn mit dem Gewehr vorausan, </ts><ts n="e" id="Seg_2898" s="T41" e="T42">• hat er den auf L einhin, </ts><ts n="e" id="Seg_2900" s="T42" e="T43">und hat ihn ins Amtsgericht aufhin, </ts><ts n="e" id="Seg_2902" s="T43" e="T44">über die ganze Stadt aufhin. </ts><ts n="e" id="Seg_2904" s="T44" e="T45">So streng waren da die Bräuche, </ts><ts n="e" id="Seg_2906" s="T45" e="T46">• gelt. </ts><ts n="e" id="Seg_2908" s="T46" e="T47">Und beim Fischen ist es das selbe. </ts><ts n="e" id="Seg_2910" s="T47" e="T48">• • Und ich weiß ja wie (unverständlich). </ts><ts n="e" id="Seg_2912" s="T48" e="T49">• Meinen Bruder haben sie auch einmal erwischt, nicht. </ts><ts n="e" id="Seg_2914" s="T49" e="T50">• Da war eine hölzerne Brücke. </ts><ts n="e" id="Seg_2916" s="T50" e="T51">• • • Und da hat man nachher geschaut, was niemand kommt, oder was, nicht. </ts><ts n="e" id="Seg_2918" s="T51" e="T52">Nachher hat sich der an die Brücke hingelegt. </ts><ts n="e" id="Seg_2920" s="T52" e="T190">Und nachher hast du hinabgeschaut bei den </ts><ts n="e" id="Seg_2922" s="T190" e="T53">Läden, </ts><ts n="e" id="Seg_2924" s="T53" e="T54">• • wo sie unten sind. </ts><ts n="e" id="Seg_2926" s="T54" e="T55">Und wenn niemand gekommen ist, </ts><ts n="e" id="Seg_2928" s="T55" e="T56">entweder geschnürt oder, </ts><ts n="e" id="Seg_2930" s="T56" e="T57">• oder, • • oder gestochen. </ts><ts n="e" id="Seg_2932" s="T57" e="T58">Ja, also jetzt muss ich von dem Schnüren noch weiter… </ts><ts n="e" id="Seg_2934" s="T58" e="T59">((atmet hörbar ein,0,3s)) Das war dann ein Kupferdraht, </ts><ts n="e" id="Seg_2936" s="T59" e="T60">und (droben) ist eine Schlaufe gewesen, nicht, </ts><ts n="e" id="Seg_2938" s="T60" e="T61">und da hat ihm der ein so ein Stängel abgeschnitten, </ts><ts n="e" id="Seg_2940" s="T61" e="T62">je nachdem, wie tief dass es gewesen ist, </ts><ts n="e" id="Seg_2942" s="T62" e="T63">und hat (Pause,0,9s) (hörbares Einatmen,0,5s) den Draht in das Stängel festgemacht. </ts><ts n="e" id="Seg_2944" s="T63" e="T64">• • Und der Fisch, wenn er unten gestanden ist, </ts><ts n="e" id="Seg_2946" s="T64" e="T65">und hat sich nicht gerührt, </ts><ts n="e" id="Seg_2948" s="T65" e="T189">• • dann ist er ihm mit dem </ts><ts n="e" id="Seg_2950" s="T189" e="T191">Glang </ts><ts n="e" id="Seg_2952" s="T191" e="T66">einhergefahren, so weit, </ts><ts n="e" id="Seg_2954" s="T66" e="T67">• • bis hinter die ersten (unverständlich,0,3s) bis die Kiemen hinterher, </ts><ts n="e" id="Seg_2956" s="T67" e="T68">und nachher hat er angezogen. </ts><ts n="e" id="Seg_2958" s="T68" e="T69">Oftmals, wenn er natürlich an Fisch hingekommen ist, </ts><ts n="e" id="Seg_2960" s="T69" e="T70">• nachher ist der Fisch fort wie der Teufel, </ts><ts n="e" id="Seg_2962" s="T70" e="T71">• das hat nicht jedes Mal geraten. </ts><ts n="e" id="Seg_2964" s="T71" e="T72">Was alte Fischer gewesen sind, die haben das können, </ts><ts n="e" id="Seg_2966" s="T72" e="T73">ne </ts><ts n="e" id="Seg_2968" s="T73" e="T74">• • • Und das Zweite war da, </ts><ts n="e" id="Seg_2970" s="T74" e="T75">das war der Stecher, ned. </ts><ts n="e" id="Seg_2972" s="T75" e="T76">• • • Der hat (alleweil, sagt nachher) der Schmied, </ts><ts n="e" id="Seg_2974" s="T76" e="T77">• • der hat da ein altes, äh, </ts><ts n="e" id="Seg_2976" s="T77" e="T78">• • • eine alte Mistgabel, eine (zugenützte), </ts><ts n="e" id="Seg_2978" s="T78" e="T79">• und da hat er das Haus hergenommen, </ts><ts n="e" id="Seg_2980" s="T79" e="T80">also da, wo der Stiel hineingeht, </ts><ts n="e" id="Seg_2982" s="T80" e="T81">• • und nachher hat er vier oder fünf, ich meine fünf • • hat er so Zacken hingeschweisst. </ts><ts n="e" id="Seg_2984" s="T81" e="T82">• • (hörbares Einatmen,0,3s) und die Zacken hat er dann mit der </ts><ts n="e" id="Seg_2986" s="T82" e="T83">Schroten, </ts><ts n="e" id="Seg_2988" s="T83" e="T84">nach hat er auch so einen Fischgrät hinein. </ts><ts n="e" id="Seg_2990" s="T84" e="T192">• • • Und den hat man auch in die </ts><ts n="e" id="Seg_2992" s="T192" e="T193">Joppentasche </ts><ts n="e" id="Seg_2994" s="T193" e="T85">einhinschieben können, ned. </ts><ts n="e" id="Seg_2996" s="T85" e="T86">Und nach hat ihm der ein Stängel abgeschnitten, </ts><ts n="e" id="Seg_2998" s="T86" e="T87">(auch) unten in dem Griesholz, </ts><ts n="e" id="Seg_3000" s="T87" e="T88">da ist es ja nicht so genau gegangen. </ts><ts n="e" id="Seg_3002" s="T88" e="T89">Ein feststehendes Messer, früher hat ja jeder ein feststehendes Messer gehabt. </ts><ts n="e" id="Seg_3004" s="T89" e="T90">• Kein Taschenmesser, • • alle ein feststehendes Messer! </ts><ts n="e" id="Seg_3006" s="T90" e="T91">Und einen Schneid dran wie der Teufel </ts><ts n="e" id="Seg_3008" s="T91" e="T17"><![CDATA[ ]]></ts><ts n="e" id="Seg_3010" s="T17" e="T92">• (atmet hörbar ein) Und nach hat er ihm dann ein Stängel abgeschnitten </ts><ts n="e" id="Seg_3012" s="T92" e="T93">und nach hat er das da vorn hinan und wenn der Fisch unten gewesen ist nach hat er, </ts><ts n="e" id="Seg_3014" s="T93" e="T94">((Pause,0,4s)) </ts><ts n="e" id="Seg_3016" s="T94" e="T95">abhingestossen, </ts><ts n="e" id="Seg_3018" s="T95" e="T96">das war natürlich wesentlich sicheriger, </ts><ts n="e" id="Seg_3020" s="T96" e="T97">als wie der Schnürer. </ts><ts n="e" id="Seg_3022" s="T97" e="T98">Weil bis der Fisch das gespürt hat, </ts><ts n="e" id="Seg_3024" s="T98" e="T99">dass der… </ts><ts n="e" id="Seg_3026" s="T99" e="T100">derweil hat ihm der da schon durchgestochen gehabt, ne. </ts><ts n="e" id="Seg_3028" s="T100" e="T101">Und dann haben sie noch gegroppt, </ts><ts n="e" id="Seg_3030" s="T101" e="T102">ist ein so klar. </ts><ts n="e" id="Seg_3032" s="T102" e="T199">Das hand, </ts><ts n="e" id="Seg_3034" s="T199" e="T103">das hand • • eine </ts><ts n="e" id="Seg_3036" s="T103" e="T104">Schlei, </ts><ts n="e" id="Seg_3038" s="T104" e="T105">zum Beispiel, ist eine Schlei, </ts><ts n="e" id="Seg_3040" s="T105" e="T106">die hat ein recht ein großes Maul vorne und hinten, </ts><ts n="e" id="Seg_3042" s="T106" e="T107">und dem, die, </ts><ts n="e" id="Seg_3044" s="T107" e="T108">die tun sich hauptsächlich in </ts><ts n="e" id="Seg_3046" s="T108" e="T109">Letten, </ts><ts n="e" id="Seg_3048" s="T109" e="T110">auch drinnen. </ts><ts n="e" id="Seg_3050" s="T110" e="T111">Also, der Letten, das ist… </ts><ts n="e" id="Seg_3052" s="T111" e="T112">ah, wie muss ich denn jetzt da sagen? </ts><ts n="e" id="Seg_3054" s="T112" e="T197">Das ist auch ein so ein Ausdruck. </ts></ts><ts n="sc" id="Seg_3055" s="T113" e="T122"><ts n="e" id="Seg_3057" s="T113" e="T114">Ein Letten ist ein Schlamm, </ts><ts n="e" id="Seg_3059" s="T114" e="T198">ist ein Letten…  </ts><ts n="e" id="Seg_3061" s="T198" e="T115">(atmet hörbar ein) </ts><ts n="e" id="Seg_3063" s="T115" e="T194">und da haben die </ts><ts n="e" id="Seg_3065" s="T194" e="T195">Hunde </ts><ts n="e" id="Seg_3067" s="T195" e="T116">das genau gewusst. </ts><ts n="e" id="Seg_3069" s="T116" e="T117">Die haben ihm die Hosen aufgeschlitzt bis da aufher und unter den Bruchsteinen drinnen, </ts><ts n="e" id="Seg_3071" s="T117" e="T118">und da hand sie dann mit den zwei Händen rein • • zack, </ts><ts n="e" id="Seg_3073" s="T118" e="T119">und da haben sie ihn schon gehabt auch. </ts><ts n="e" id="Seg_3075" s="T119" e="T120">Ah, oftmals ist er ihnen auch ausgkommen, nicht, </ts><ts n="e" id="Seg_3077" s="T120" e="T121">voraus der Schlei, </ts><ts n="e" id="Seg_3079" s="T121" e="T122">weil der recht rutschig gewesen ist. </ts></ts></segmentation><annotation name="" tierref="TIE3"><ta id="Seg_3080" s="T15" e="T18"></ta></annotation><annotation name="teu" tierref="TIE2"><ta id="Seg_3081" s="T0" e="T1">i;a5-2do5-2ho5-dma2+-2e2a,s72d2a2mo2e2g2ho5-d</ta><ta id="Seg_3082" s="T1" e="T2">a2-2e2so2-2de2-se2a,s72d2e2wa5-da2-2s7ni-2e,ra2</ta><ta id="Seg_3083" s="T2" e="T3">u5nd2e2-swa6-2ra24 / a2s72d2a